import React from 'react';
import styled from '@emotion/styled';

const Btn = styled.input`
    position: absolute;
    top: 5px;
    right: 5px;
`;


const SwitcherTheme = () => {
    return (<Btn type="checkbox" id="switch" name="theme" />);
}

export default SwitcherTheme;
